  downloadPdf(){
    const loader = this.loadingCtrl.create({
      content: "Downloading...",
    });
    loader.present();

    setTimeout(() => {
      if (this.plt.is('cordova')) {
        // FOR MOBILE DEVICES
        this.pdfObj.getBuffer((buffer) =>{
          var utf8 = new Uint8Array(buffer); // Convert to UTF-8...
          let binaryArray = utf8.buffer; // Convert to Binary...

      
          let dirPath = "";
          if (this.plt.is('android')) {
          dirPath = this.file.externalRootDirectory;
          } else if (this.plt.is('ios')) {
          dirPath = this.file.documentsDirectory;
          }
      
          let dirName = 'EuroPDF';
      
          this.file.createDir(dirPath, dirName, true).then((dirEntry) => {
          let saveDir = dirPath + '/' + dirName + '/';
          this.file.createFile(saveDir, 'FilledCVI.pdf', true).then((fileEntry) => {
            fileEntry.createWriter((fileWriter) => {
            
              this.fileOpener.open(saveDir + 'FilledCVI.pdf', 'application/pdf')
                .then(() => console.log('File is opened'))
                .catch(e => console.log('Error openening file', e));
            
            fileWriter.write(binaryArray);
            });
          });
          });
        });
        }
        else{
          this.pdfObj.open();
        }
  }, 500);

  setTimeout(() => {
   loader.dismiss();
 }, 500); 
  }
